  return (
    <Routes>
      <Route path='/' element = {Layout}>

      </Route>
      <Route index element = {
        <main>
          <Header />
          <Post />
          <Post />
          <Post />
        </main>
      } />
      <Route path={'/login'} element = {
        <main>
          <Header />
          <div>Login</div>
        </main>
      } />
    </Routes>
  );
}

export default App;
